const Task = (value) => {
  return (
    <li>{value}</li>
  );
}
function App() {
  const info = [Task('Um elefante incomoda muita gente!'), Task('Dois elefantes incomodam muito mais!'), Task('Três elefantes incomodam muita gente!'), Task('Quatro elefantes incomodam muito mais!') ];
